and exit our program. The exact error message is ERROR: INVALID INPUT, and we can skip the rest of our main function with an empty return statement. All together, it looks like this: // prompt for input
int variableName = Integer.parseInt(readln("level prompt message")); // check for invalid input
if (/*TODO: condition*/) { println("ERROR: INVALID INPUT"); // exit main function early return;
} You can use a similar prompt to check each ability score, which must be an integer between 8 and 15 inclusive. After you add the error-checking for the level and abilities, you should test each of them a few times. Try values both inside and outside the range, and make sure the program exits with the error message if and only if you enter a value outside the range. In particular, you should check the boundaries of the range. One of the most common mistakes in this type of code is to make a range inclusive when it should have been exclusive, or to make it exclusive when it should have been inclusive. If you make that mistake, then your code will work correctly for all but one or two numbers. You should check 0, 1, 20, and 21 for the level, as well as 7, 8, 15, and 16 for the ability scores. Once your error-checking code works for the numbers, you also need to check the ancestry and class. Each of these have three options, and the user's input is invalid if it is not equal to one of these options. This means we have three parts to our condition, and they must be joined with AND or OR. Which is appropriate? Let's try describing invalid input more closely to how we would code it (checking each possibility separately) and see whether AND or OR is more natural: an invalid ancestry is not an elf and it is not a dwarf and it is not a human. Therefore we should use AND (&&). However, this can be tricky. There's another way to phrase our condition that sounds natural and uses OR instead of AND: "an invalid ancestry is not an elf or a dwarf or a human". Does this mean it doesn't matter whether we use AND or OR? The trick with this phrase is how it looks when structured like code: "it is not true that (an invalid ancestry is an elf or it is a dwarf or it is a human)." We are using or to join several equality checks (instead of inequality checks), then applying the NOT (!) to the entire expression, which I've indicated by wrapping most of the expression in parenthesis. You'll develop an intuition for boolean logic with practice, so don't worry if you had a hard time with this part. I'll summarize everything you need to know for the AND solution to this error check: Check whether the ancestry/class is NOT equal to each option. Join each of these comparisons with AND (&&). Never compare strings with s1 == s2 or s1 != s2. This will not work as you want it to. Instead, compare them using the .equals function: s1.equals(s2) for equality and !s1.equals(s2) for inequality. Valid ancestries are "elf", "human", and "dwarf". Valid classes are "fighter", "rogue", and "ranger". Use the lowercase versions of these names. I will only use lowercase input for these traits when testing your code, so you can assume that all input is lowercase. Remember to test your new error-checking code. You should now get an error message if you don't enter a valid ancestry or class, but the program should still work if you enter valid input for everything. Now we need to update the calculations. We can break this into three phases: adjust ability scores, calculate ability modifiers, and calculate other values. We'll start with adjusting the ability scores. Each ancestry changes one or more ability scores. Humans increase all of their scores by 1, elves increase their dexterity by 2, and dwarves increase their constitution by 2. You can structure this part as an else-if chain: if (variableName.equals("ancestry1")) { // TODO: adjust ability scores for ancestry 1
