Create a file named DiceGame1.java in your projects folder. Create a file named Dice.java in your projects folder and copy the code below into this file. You are required to use the functions in Dice.java to generate all random numbers in your program. /** * Simulates dice rolls with Math.random(). Includes convenience methods for * polyhedral dice (d4, d6, d8, d10, d12, d20). * * This class is included as starter code so that my tests can replace it with a * fake random number generator that supplies a predetermined series of numbers * instead of simulating dice rolls. This makes it easier to write test cases, * but it means you MUST use these functions to generate your random numbers. * * @author Zach Kohlberg */
public class Dice { public static int roll(int sides) { return (int) (Math.random() * sides) + 1; } public static int d4() { return roll(4); } public static int d6() { return roll(6); } public static int d8() { return roll(8); } public static int d10() { return roll(10); } public static int d12() { return roll(12); } public static int d20() { return roll(20); }
}

